import './App.css';
import {BrowserRouter, Route, Routes} from 'react-router-dom'
import LandingPage from './components/LandingPage';
import Home from './components/Home';
import SearchBar from './components/SearchBar';
import GameDetail from './components/GameDetail';
import NavBar from './components/Navbar';
import Create from './components/Create';

//10) envuelvo todo en browserRouter
function App() {
  return (
    <BrowserRouter>

    <div className="App">
    <Routes>
      <Route exact path="/" element={<LandingPage/>} />
      {/* <Route path="/home" element={<NavBar/>} /> */}
      <Route exact path="/home" element={<Home/>} />
      <Route path="/results" element={<NavBar/>} />

      <Route exact path="/results/:name" element={<SearchBar/>} />
      <Route path="/videogames" element={<NavBar/>} />
      <Route exact path="/videogames/:id" element={<GameDetail/>}/>
      {/* <Route path="/create" element={<NavBar/>} />   */}
      <Route path="/create" exact element={<Create/>} />
      <Route path="/about" element={<NavBar/>} />










    </Routes>
    </div>

    </BrowserRouter>
  );
}

export default App;
